import React from 'react';
import Navbar from '../components/Navbar/Navbar'

const InicioPagina = () => {
  return (
    <>
      <Navbar/>
      <div className="hero-image-wrapper">
        <div>
          <h1>Envios</h1>
          <h1>Eficientes</h1>
          <p>La mejor calidad y profesionalismo en servicios de entrega local y nacional para negocios</p>
        </div>
      </div>
    </>
  )
}

export default InicioPagina;
